import React from "react";
// Import Component MUI
import {
  AppBar,
  Box,
  Button,
  Card,
  CardContent,
  CardMedia,
  Container,
  Grid,
  IconButton,
  InputAdornment,
  TextField,
  Typography,
  // InputBase,
} from "@mui/material";
import { CardActionArea } from "@mui/material";
// Import Icon
import ChevronLeftRoundedIcon from "@mui/icons-material/ChevronLeftRounded";
import SearchIcon from "@mui/icons-material/Search";
import "boxicons";
// Import Images
import images from "../assets/images/noimage.jpg";

export default function ListSertifikat() {
  return (
    <>
      <Container>
        {/* Button & Title Sertifikat */}
        <AppBar
          position="fixed"
          elevation="none"
          sx={{
            xs: 12,
            bgcolor: "#249EA0",
            width: "100%",
            height: "55px",
          }}
        >
          <Box sx={{ width: "100%" }}>
            <IconButton
              sx={{
                color: "#000",
                "&:hover, &.Mui-focusVisible": {
                  background: "transparent",
                  borderRadius: "0%",
                },
              }}
            >
              {/* Icon */}
              <ChevronLeftRoundedIcon sx={{ fontSize: 40 }} />
              {/* Title */}
              <Typography sx={{ fontSize: 20, fontWeight: "bold" }}>
                Sertifikat
              </Typography>
            </IconButton>
          </Box>
        </AppBar>

        <Box sx={{ mt: 10 }}>
          {/* Search & Icon Button Setting */}
          <Grid container direction="row">
            {/* Search */}
            <Grid item xs={11}>
              <TextField
                placeholder="Search"
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">
                      <IconButton>
                        <SearchIcon sx={{ fontSize: 30 }} />
                      </IconButton>
                    </InputAdornment>
                  ),
                }}
                sx={{
                  width: "100%",
                  "&:hover .MuiOutlinedInput-root .MuiOutlinedInput-notchedOutline":
                    {
                      borderColor: "#249EA0",
                    },
                  "& .MuiOutlinedInput-root.Mui-focused .MuiOutlinedInput-notchedOutline":
                    {
                      borderColor: "#249EA0",
                    },
                }}
              />
            </Grid>
            {/* Icon Button */}
            <Grid item xs={1} color="#0000008A">
              <IconButton>
                <box-icon name="slider-alt" size="md" />
              </IconButton>
            </Grid>
          </Grid>

          {/* Card */}
          <Grid
            container
            direction={{ xs: "column", md: "row", xl: "row" }}
            justifyContent="center"
            alignItems="center"
          >
            {/* Card 1 */}
            <Grid item xs={12} md={6} xl={6}>
              <Card
                sx={{
                  width: {
                    lg: "90%",
                    md: "90%",
                    xs: "100%",
                  },
                  height: {
                    lg: 317,
                    md: 310,
                    xs: 310,
                  },
                  mt: 2,

                  border: "#0000008A solid",
                }}
              >
                <CardActionArea>
                  {/* Image */}
                  <CardMedia
                    component="img"
                    height="220"
                    image={images}
                    alt="sertifikat"
                  />
                  <CardContent>
                    {/* Title */}
                    <Typography
                      sx={{
                        mt: -1.5,
                        mb: 0,
                        fontWeight: "bold",
                        fontSize: {
                          lg: "19px",
                          md: "19px",
                          xs: "16px",
                        },
                      }}
                    >
                      KEJUARAAN WAKODAI MONAS CUP 2016
                    </Typography>
                    {/* Description */}
                    <Typography
                      sx={{
                        mb: 1,
                        fontSize: {
                          lg: "18px",
                          md: "18px",
                          xs: "16px",
                        },
                      }}
                    >
                      Juara 2 - Kumite Perorangan Putri -48 Kg
                    </Typography>
                    {/* Date */}
                    <Typography
                      sx={{
                        fontSize: {
                          lg: "15px",
                          md: "15px",
                          xs: "14px",
                        },
                      }}
                    >
                      26 Juli 2016
                    </Typography>
                  </CardContent>
                </CardActionArea>
              </Card>
            </Grid>

            {/* Card 1 */}
            <Grid item xs={12} md={6} xl={6}>
              <Card
                sx={{
                  width: {
                    lg: "90%",
                    md: "90%",
                    xs: "100%",
                  },
                  height: {
                    lg: 317,
                    md: 310,
                    xs: 310,
                  },
                  mt: 2,

                  border: "#0000008A solid",
                }}
              >
                <CardActionArea>
                  {/* Image */}
                  <CardMedia
                    component="img"
                    height="220"
                    image={images}
                    alt="sertifikat"
                  />
                  <CardContent>
                    {/* Title */}
                    <Typography
                      sx={{
                        mt: -1.5,
                        mb: 0,
                        fontWeight: "bold",
                        fontSize: {
                          lg: "19px",
                          md: "19px",
                          xs: "16px",
                        },
                      }}
                    >
                      KEJUARAAN WAKODAI MONAS CUP 2016
                    </Typography>
                    {/* Description */}
                    <Typography
                      sx={{
                        mb: 1,
                        fontSize: {
                          lg: "18px",
                          md: "18px",
                          xs: "16px",
                        },
                      }}
                    >
                      Juara 2 - Kumite Perorangan Putri -48 Kg
                    </Typography>
                    {/* Date */}
                    <Typography
                      sx={{
                        fontSize: {
                          lg: "15px",
                          md: "15px",
                          xs: "14px",
                        },
                      }}
                    >
                      26 Juli 2016
                    </Typography>
                  </CardContent>
                </CardActionArea>
              </Card>
            </Grid>
          </Grid>
          {/* Button */}
          <Grid justifyContent="center">
            <Grid item align="right">
              <Button
                variant="contained"
                color="warning"
                sx={{
                  mt: 5,
                  mb: 3,
                  mr: {
                    xl: 5,
                  },
                  width: "50",
                  height: "50",
                  fontSize: 20,
                }}
              >
                +
              </Button>
            </Grid>
          </Grid>
        </Box>
      </Container>
    </>
  );
}
